import React, { useState } from 'react';

const FeedbackTable = () => {
  const [data, setData] = useState([
    // Populate with initial data if needed, or leave empty
  ]);
  const [searchQuery, setSearchQuery] = useState('');

  // Inline styles for full-page layout
  const styles = {
    container: {
      width: '100%',
      minHeight: '100vh',
      padding: '20px',
      backgroundColor: '#f3f4f6',
      boxSizing: 'border-box',
    },
    header: {
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      marginBottom: '20px',
    },
    title: {
      fontSize: '24px',
      color: '#333',
      fontWeight: 'bold',
    },
    searchInput: {
      padding: '8px 12px',
      borderRadius: '4px',
      border: '1px solid #ccc',
      outline: 'none',
      fontSize: '16px',
    },
    tableWrapper: {
      overflowX: 'auto', // Makes table horizontally scrollable on small screens
    },
    table: {
      width: '100%',
      borderCollapse: 'collapse',
      textAlign: 'left',
      backgroundColor: '#fff',
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    },
    th: {
      padding: '12px 15px',
      backgroundColor: '#007bff',
      color: '#fff',
      fontWeight: 'bold',
      border: '1px solid #ddd',
    },
    td: {
      padding: '12px 15px',
      border: '1px solid #ddd',
    },
    evenRow: {
      backgroundColor: '#f9f9f9',
    },
  };

  // Filtered data based on search query
  const filteredData = data.filter((item) =>
    Object.values(item).some((val) =>
      val.toLowerCase().includes(searchQuery.toLowerCase())
    )
  );

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <h1 style={styles.title}>Feedback Table</h1>
        <input
          type="text"
          placeholder="Search..."
          style={styles.searchInput}
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
      </div>

      <div style={styles.tableWrapper}>
        <table style={styles.table}>
          <thead>
            <tr>
              <th style={styles.th}>Register Number</th>
              <th style={styles.th}>Category</th>
              <th style={styles.th}>Heading</th>
              <th style={styles.th}>Summary</th>
            </tr>
          </thead>
          <tbody>
            {filteredData.length > 0 ? (
              filteredData.map((item, index) => (
                <tr
                  key={index}
                  style={index % 2 === 0 ? styles.evenRow : null}
                >
                  <td style={styles.td}>{item.registerNumber}</td>
                  <td style={styles.td}>{item.category}</td>
                  <td style={styles.td}>{item.heading}</td>
                  <td style={styles.td}>{item.summary}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td style={styles.td} colSpan="4" align="center">
                  No records found.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default FeedbackTable;
